using System;
using System.Text;
using Windows.UI.Xaml.Controls;
using Windows.System.Profile;
using Windows.UI.ViewManagement;
using Windows.UI;

// The Blank Page item template is documented at https://go.microsoft.com/fwlink/?LinkId=402352&clcid=0x409

namespace Couch_2048
{
    /// <summary>
    /// An empty page that can be used on its own or navigated to within a Frame.
    /// </summary>
    public sealed partial class MainPage : Page
    {
        private string gamestring = "";

        public MainPage()
        {
            this.InitializeComponent();
            SetFullscreenForLumia();
            LoadBase64Html();
            SetCustomTitleBar();
        }

        private void SetFullscreenForLumia()
        {
            // Check if the device is a mobile (Lumia) device
            var deviceFamily = AnalyticsInfo.VersionInfo.DeviceFamily;

            if (deviceFamily == "Windows.Mobile")
            {
                Windows.UI.ViewManagement.ApplicationView.GetForCurrentView().TryEnterFullScreenMode();
            }
        }

        // Mark this method as async and return Task
        private void LoadBase64Html()
        {

            // Decode the Base64 string (no async needed)
            byte[] htmlBytes = Convert.FromBase64String(gamestring);

            // Convert the byte array to a string
            string htmlContent = Encoding.UTF8.GetString(htmlBytes);

            Game.IsTapEnabled = false;
            Game.IsRightTapEnabled = false;

            string disableZoomScript = @"
                var meta = document.createElement('meta');
                meta.name = 'viewport';
                meta.content = 'width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no';
                document.getElementsByTagName('head')[0].appendChild(meta);
            ";

            // Load the decoded HTML into the WebView
            Game.NavigateToString(htmlContent);
            Game.InvokeScriptAsync("eval", new string[] { disableZoomScript });
        }

        private void SetCustomTitleBar()
        {
            // Set a custom title bar color using hex color #455964
            var titleBar = ApplicationView.GetForCurrentView().TitleBar;

            titleBar.BackgroundColor = Color.FromArgb(255, 69, 89, 100); // #455964
            titleBar.ForegroundColor = Colors.White;   // Set text color to white
            titleBar.InactiveBackgroundColor = Color.FromArgb(255, 69, 89, 100); // Set inactive background color
            titleBar.InactiveForegroundColor = Colors.Gray; // Set inactive text color

            // Set the window button color (minimize, maximize, close)
            titleBar.ButtonBackgroundColor = Color.FromArgb(255, 69, 89, 100); // Button background color
            titleBar.ButtonForegroundColor = Colors.White; // Button icon color (close, minimize, maximize)
            titleBar.ButtonInactiveBackgroundColor = Color.FromArgb(255, 69, 89, 100); // Inactive button background
            titleBar.ButtonInactiveForegroundColor = Colors.Gray; // Inactive button icon color
        }
    }
}
